import Container from 'react-bootstrap/Container'
import Navbar from 'react-bootstrap/Navbar'
import './Header.css'
const Header = () => {
    return (
        <Container className='appHeader m-0 mw-100'>
            <Navbar className='p-0'>
                <Navbar.Brand href="#home">CERRAR SESION</Navbar.Brand>
            </Navbar>
        </Container>
    );
}
 
export default Header
